package eth_test

import (
	"fmt"
	"moralis-webhook/eth"
	"testing"
)

func TestMethodId(t *testing.T) {
	multisigInterface, _ := eth.MultisigMetaData.GetAbi()
	for name, m := range multisigInterface.Methods {
		fmt.Printf("Method %v (id %x) \n", name, m.ID)
	}
}

func TestInputDecoder(t *testing.T) {
	input := ""

	parsedSubmitTransaction, err := eth.InputDataDecoder(input)
	if err != nil {
		panic(err)
	}
	fmt.Println(parsedSubmitTransaction)
}
